import { Ionicons } from '@expo/vector-icons';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import * as React from 'react';

import Colors from '../constants/Colors';
import useColorScheme from '../hooks/useColorScheme';
import {
    BottomTabParamList,
    AcceuilParamList,
    ProfilParamList,
    FacturesParamList, ComptesParamList, CreancesParamList
} from '../types';
import AcceuilScreen from "../views/AcceuilScreen";
import ProfilScreen from "../views/ProfilScreen";
//import FacturesScreen from "../views/FacturesScreen";
//import  creancierView from "../views/FacturesScreen";
import ComptesScreen, {ComptesListState} from "../views/ComptesScreen";
import {CreancesListState, CreancierListState} from "../views/FacturesScreen";
// import CreancierViewState from "../views/FacturesScreen";
// import Creanciers from "../views/FacturesScreen";
// import CreanciersList from "../views/FacturesScreen";
// import FacturesScreen from "../views/FacturesScreen";
import {bindActionCreators} from "redux";
import {getCreanciers} from "../redux/actions/creanciers-actions";
import {connect} from "react-redux";
import {fetchCreanciers} from "../services/creanciers-service";

const BottomTab = createBottomTabNavigator<BottomTabParamList>();

export default function BottomTabCreancier() {
  const colorScheme = useColorScheme();

  return (

    <BottomTab.Navigator

      initialRouteName="Accueil"
      tabBarOptions={{ activeTintColor: Colors[colorScheme].tint }}>
        <BottomTab.Screen
            name="CreancesScreen"
            component={CreancesNavigator}
            options={{
                tabBarIcon: ({ color }) => <TabBarIcon name="clipboard" color={color} />,
            }}
        />
    </BottomTab.Navigator>

  );
}

// You can explore the built-in icon families and icons on the web at:
// https://icons.expo.fyi/
function TabBarIcon(props: { name: React.ComponentProps<typeof Ionicons>['name']; color: string }) {
  return <Ionicons size={30} style={{ marginBottom: -3 }} {...props} />;
}

// Each tab has its own navigation stack, you can read more about this pattern here:
// https://reactnavigation.org/docs/tab-based-navigation#a-stack-navigator-for-each-tab


const CreancesStack = createStackNavigator<CreancesParamList>();

function CreancesNavigator() {
    return (
        <CreancesStack.Navigator>
            <CreancesStack.Screen
                name="Creancier"
                component={CreancesListState}
                options={{ headerTitle: 'Liste des Creances' }}
            />
        </CreancesStack.Navigator>
    );
}
